// N8N Code Node to replace DYNAMIC CONTRACT NODE
// This node processes incoming contract data and formats it for NODO API

// Get the input data from the webhook - data comes in body
const inputData = $input.all()[0].json.body || $input.all()[0].json;

// Extract contract_data object and other fields
const contractData = inputData.contract_data || {};
const tipoEmpresa = inputData.tipo_empresa || '';
const telefono = inputData.telefono || '';
const comercializadora = inputData.comercializadora || '';
const concepto = inputData.concepto || '';
const cnae = inputData.cnae || '9820';
const observaciones = inputData.observaciones || 'Contrato generado desde Tunerface';
const tipoContratacion = inputData.tipo_contratacion || '';
const comercial = inputData.comercial || '1731';
const firmaDigital = inputData.firma_digital || '0';
const factElectronica = inputData.fact_electronica || 'NO';
const luzAutoconsumo = inputData.luz_autoconsumo || 'NO';

// Helper function to safely parse numeric values (handles strings and numbers)
function parseNumeric(value) {
  if (value === null || value === undefined || value === '') return 0;
  const parsed = parseFloat(value);
  return isNaN(parsed) ? 0 : parsed;
}

// Prepare the formatted data object
const formattedData = {
  contract_data: {
    titular: contractData.titular || '',
    nif: contractData.nif || '',
    direccion_fiscal: contractData.direccion_fiscal || '',
    cp_fiscal: contractData.cp_fiscal || '',
    poblacion_fiscal: contractData.poblacion_fiscal || '',
    provincia_fiscal: contractData.provincia_fiscal || '',
    email: contractData.email || '',
    movil: contractData.movil || '',
    cups: contractData.cups || '',
    comercializadora_actual: contractData.comercializadora_actual || '',
    direccion_suministro: contractData.direccion_suministro || '',
    poblacion_suministro: contractData.poblacion_suministro || '',
    provincia_suministro: contractData.provincia_suministro || '',
    cp_suministro: contractData.cp_suministro || '',
    iban: contractData.iban || '',
    consumo_anual_kwh: parseNumeric(contractData.consumo_anual_kwh),
    potencia_p1: parseNumeric(contractData.potencia_p1),
    potencia_p2: parseNumeric(contractData.potencia_p2),
    potencia_p3: parseNumeric(contractData.potencia_p3),
    potencia_p4: parseNumeric(contractData.potencia_p4),
    potencia_p5: parseNumeric(contractData.potencia_p5),
    potencia_p6: parseNumeric(contractData.potencia_p6),
    consumo_p1: parseNumeric(contractData.consumo_p1),
    consumo_p2: parseNumeric(contractData.consumo_p2),
    consumo_p3: parseNumeric(contractData.consumo_p3),
    consumo_p4: parseNumeric(contractData.consumo_p4),
    consumo_p5: parseNumeric(contractData.consumo_p5),
    consumo_p6: parseNumeric(contractData.consumo_p6),
    tarifa_acceso: contractData.tarifa_acceso || ''
  },
  tipo_empresa: tipoEmpresa,
  telefono: telefono,
  comercializadora: comercializadora,
  concepto: concepto,
  cnae: cnae,
  observaciones: observaciones,
  tipo_contratacion: tipoContratacion,
  comercial: comercial,
  firma_digital: firmaDigital,
  fact_electronica: factElectronica,
  luz_autoconsumo: luzAutoconsumo
};

// Return the formatted data
return [{
  json: formattedData
}];

const root = items[0].json;

// Step 1: Get raw payload (string or object)
let rawPayload = root.data ?? root.body ?? root;

// Step 2: Parse if it's a string
let payload;
if (typeof rawPayload === 'string') {
  try {
    payload = JSON.parse(rawPayload);
  } catch (e) {
    throw new Error('Failed to parse JSON string in data/body');
  }
} else {
  payload = rawPayload;
}

// Step 3: Validate suministros
if (!Array.isArray(payload.suministros) || payload.suministros.length === 0) {
  throw new Error(
    "No 'suministros' array found after parsing. Keys: " +
    Object.keys(payload).join(', ')
  );
}

// Step 4: Take first suministro
const s = payload.suministros[0];

// Helper: number coercion
const num = (v) =>
  v === null || v === undefined || v === '' ? null : Number(v);

// Helper: get text before slash (for provincia)
const beforeSlash = (v) => {
  if (!v) return null;
  return v.split('/')[0].trim();
};

// Step 5: Clean output
const cleanJson = {
  kWhAnual: num(s.kWhAnual),

  kWhAnual_p1: num(s.kWhAnual_p1),
  kWhAnual_p2: num(s.kWhAnual_p2),
  kWhAnual_p3: num(s.kWhAnual_p3),
  kWhAnual_p4: num(s.kWhAnual_p4),
  kWhAnual_p5: num(s.kWhAnual_p5),
  kWhAnual_p6: num(s.kWhAnual_p6),

  Pot_Cont_P1: num(s.Pot_Cont_P1),
  Pot_Cont_P2: num(s.Pot_Cont_P2),
  Pot_Cont_P3: num(s.Pot_Cont_P3),
  Pot_Cont_P4: num(s.Pot_Cont_P4),
  Pot_Cont_P5: num(s.Pot_Cont_P5),
  Pot_Cont_P6: num(s.Pot_Cont_P6),

  cnae_code: s.cnae_code ?? null,
  Tarifa: s.Tarifa ?? null,

  // Location fields (provincia cleaned to remove alternate names after /)
  Cod_Postal_Suministro: s.Cod_Postal_Suministro ?? null,
  Provincia_Suministro: beforeSlash(s.Provincia_Suministro)
};

return [{ json: cleanJson }];

// Extract contract ID from NODO response
const nodoResponse = $input.item.json;

// Get data from the original webhook
const webhookData = $('Crear Contrato en NODO').item.json.body || $('Crear Contrato en NODO').item.json;
const contractData = webhookData.contract_data || {};
const documentsArray = webhookData.documents || [];

let contratoId = 'N/A';

// NODO API returns: { resultado: 'OK', id: ..., id_operacion: ... }
if (nodoResponse.data && nodoResponse.data.id) {
  contratoId = nodoResponse.data.id;
} else if (nodoResponse.id) {
  contratoId = nodoResponse.id;
} else {
  throw new Error('No se pudo obtener el ID del contrato creado');
}

// Debug logging
console.log('Contract ID:', contratoId);
console.log('Documents found:', documentsArray.length);

// If no documents, return message
if (!documentsArray || documentsArray.length === 0) {
  return [{
    json: {
      message: 'No documents to upload',
      contrato_id: contratoId,
      _metadata: {
        contrato_id: contratoId,
        cups: contractData.cups,
        email: contractData.email,
        titular: contractData.titular
      }
    }
  }];
}

// Process documents array - each document has: id, filename, data (base64)
const documents = documentsArray.map(doc => ({
  json: {
    contrato_id: contratoId,
    tipo: 'DOCUMENTACIÓN',
    archivo_base64: doc.data,
    nombre_archivo: doc.filename,
    _metadata: {
      contrato_id: contratoId,
      cups: contractData.cups,
      email: contractData.email,
      titular: contractData.titular
    }
  }
}));

console.log('Documents prepared for upload:', documents.length);

return documents;
